script: |
  super -f text -I q9078.spq | sort > q9078.out

inputs:
  - name: q9078.spq
    data: |
      SELECT + + ( - - col0 ) AS col1 FROM tab2 (FORMAT parquet) WHERE col0 * - CAST ( NULL AS INTEGER ) + + + col2 - col1 - - col0 NOT BETWEEN col2 AND 25;
  - name: tab2

outputs:
  - name: q9078.out
    data: |
